import React from 'react';
import Heading from './Heading';
import Para from './Para';
import Greeting from './Greeting';
import './index.css';
import List from './List';
import * as someName from './List';

function App() {
    return (
        <>
            <Para/>
            <Heading />
            <Para />
            <Greeting />
            <List/>
            {someName.default}
            {someName.fav2}
            {someName.fav3}
        </>
    )
}

export default App;
